import React, { Component } from 'react'
import {Link} from 'react-router-dom'

class Medicines extends Component {
     render() {
        return (
            <div className= "row">
            <div className='col text-center pt-5' style={{width:"50vh" , height: "40vh"}}>
                <Link to="/addreminder"><button className=" btn btn-danger">ADD</button></Link>
                
            <div className=" col float-right" style={{ borderStyle: "solid" , width:"40vh",height: "80vh" }}>
            </div>
            </div>
            </div>
        
        )
    }
}


export default Medicines;
